import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';


const Profile = () => {
    return(
        <>
            <Head>
                <title>Study Board | Profile</title>
            </Head>
            <AppLayout>
                <NicknameEditForm />
                <FollowList />
                <FollowerList />
            </AppLayout>
        </>
    );
}

export default Profile;
